import { Button, Header } from "@mantine/core";
import { Link } from "react-router-dom";

const Categories = () => {
  let categories = [
    "TVs",
    "Audio",
    "Smartphones",
    "Computers",
    "Consoles and games",
    "Fridges",
    "Microwaves",
    "Washing machines",
  ];

  return (
    <>
      {categories.map((category) => (
        <Button variant="subtle" sx={{ margin: "6px 0" }}>
          <Link>{category}</Link>
        </Button>
      ))}
    </>
  );
};

export default Categories;
